style.css:
@-moz-document domain("etecsa.net") {
#header, #bg, #banner_promos, .vnc, header,a[href='http://www.etecsa.cu/images/cu.sld.COVID_19_InfoCU-v3.apk'],img[src="/nauta_etecsa/OnlineURL/images/conected.png"],img[src="/nauta_etecsa/OnlineURL/images/nauta_wifi_popup.jpg"],div>span {
    display:none;
}
/*input[name='ayuda']*/

.blq>div.title, .blq_int>div.title{
    background-color: transparent;
    text-align: center;
    font-size: 20px;
}
div.cont, div#cont{
    background-color:transparent;
}

div.contenedor, div#contenedor {
    background-image: none;
    
}
body, div.contenedor, div#contenedor {
    background-color: #292929 !important;
}
div.blq, .blq_int, clearfix, .cont>div, div#cont>div {
    background-color: #292929f5 !important;
}

/*span:nth-of-type(1) {
   display:none;
}*/

input[type="button"], input[type="reset"] {
    background-color: #3a4a83;
    color: white;
    padding: 10px 10px;
    border: none;
    border-radius: 2px;
    cursor: pointer;
}
p {
    color: white;
}
input[type="button"]:hover {
    background-color: #476cf1;
}
input[type="reset"]:hover {
    background-color: #07044c;
}

td {
    font-weight: bold;
    color:gray;
}

td[id='onlineTime'], td[id='availableTime'], label, .info-white1 {
    font-weight: bold;
    color:white;
}
body {
    overflow:hidden;
}
#loading_img {
	filter:invert(85);
}
}
